import React from "react";
import { Link } from "react-router-dom";
import logo from "../../assets/logo.svg";

export const NavBar = () => {
  return (
    <header className="NavBar">
      <Link to="/">
        <h1 className="logo">
          <img src={logo} alt="Red Ventures" />
        </h1>
      </Link>
      <nav className="nav">
        <ul className="list">
          <li className="item active">Heaven Rider</li>
          <li className="item">HR 1</li>
          <li className="item">HR Mobi</li>
          <li className="item">HR Charlie</li>
          <li className="item">Model Italy</li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
